IF OBJECT_ID('dbo.proc_transform_362', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_362;
GO
CREATE PROCEDURE dbo.proc_transform_362
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_362
    SET payload = LEFT(payload, 1000) + N'|V4-362|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_362;
END
